const VERSION = 20251231;
const UPDATE_INFO_URL = "https://raw.githubusercontent.com/sluckydream/a001/refs/heads/main/ks/version.json";

const CURRENT_FILE = __filename;
const TEMP_FILE = CURRENT_FILE + ".new";

async function checkUpdate() {
  try {
    const { data } = await axios.get(UPDATE_INFO_URL, {
      timeout: 5000
    });

    if (!data || !data.ksjs.version || !data.ksjs.url) {
      console.log("更新信息格式错误");
      return;
    }

    if (data.ksjs.version > VERSION) {
      console.log(`发现新版本 ${data.ksjs.version}，开始更新...`);

      const res = await axios.get(data.ksjs.url, {
        responseType: "arraybuffer",
        timeout: 10000
      });

      fs.writeFileSync(TEMP_FILE, res.data);
      fs.copyFileSync(TEMP_FILE, CURRENT_FILE);
      fs.unlinkSync(TEMP_FILE);

      console.log("更新完成，请重启程序");
      process.exit(0);
    } else {
      console.log("当前已是最新版本");
    }
  } catch (err) {
    console.error("检查更新失败：", err.message);
  }
}
